document.addEventListener('DOMContentLoaded', function() {
    const heightInput = document.getElementById('heightInput');
    const setHeightButton = document.getElementById('setHeight');
    const heightDisplay = document.getElementById('heightDisplay');
    const recentHeights = document.getElementById('recentHeights');
    const boy = document.getElementById('boy');
    const markersContainer = document.getElementById('markersContainer');
    const genderSelect = document.getElementById('genderSelect');
    const maxHeight = 685; 
    const scaleHeight = maxHeight / 8; 

    let heightHistory = [];

    setHeightButton.addEventListener('click', function() {
        const heightValue = parseFloat(heightInput.value);
        const currentDate = new Date().toLocaleDateString(); // Get the current date

        if (heightValue >= 0 && heightValue <= 8) {
            const newHeight = heightValue * scaleHeight;
            boy.style.height = newHeight + 'px';

            // Adjust the width based on the height input
            if (heightValue >= 3 && heightValue < 5) {
                boy.style.width = '150px';
            } else if (heightValue >= 5 && heightValue <= 8) {
                boy.style.width = '270px';
            } else if (heightValue >= 0 && heightValue < 2) {
                boy.style.width = '50px';
            } else {
                boy.style.width = '80px';
            }

            // Add the active class to #boy
            if (!boy.classList.contains('active')) {
                boy.classList.add('active');
            }

            // Display the entered height
            heightDisplay.innerHTML = `<strong>Height:</strong> ${heightValue}`;

            // Update height history with height and date
            heightHistory.unshift({ height: heightValue, date: currentDate });
            if (heightHistory.length > 3) {
                heightHistory.pop();
            }

            // Display the last three heights
            recentHeights.innerHTML = `<strong>Recent Heights:</strong> ${heightHistory.map(item => `${item.height} (${item.date})`).join(' ')}`;

            // Clear old markers
            markersContainer.innerHTML = '';

            // Clear the previous div with the id `boyInfoContainer`
            const existingBoyInfoContainer = document.getElementById('boyInfoContainer');
            if (existingBoyInfoContainer) {
                existingBoyInfoContainer.remove();
            }

            // Add new markers for the last three heights
            heightHistory.forEach(item => {
                const marker = document.createElement('div');
                marker.classList.add('marker');
                const positionPercentage = (item.height / 8) * 100;
                marker.style.top = (100 - positionPercentage) + '%'; // Position marker on scale

                // Add a tooltip to display the height and date on hover
                const tooltip = document.createElement('span');
                tooltip.classList.add('tooltip');
                tooltip.innerText = `Height: ${item.height}\nDate: ${item.date}`;
                marker.appendChild(tooltip);
                markersContainer.appendChild(marker);
            });

            // Create a new div for displaying the height and date information
            const boyInfoContainer = document.createElement('div');
            boyInfoContainer.id = 'boyInfoContainer';
            boyInfoContainer.innerHTML = `<p><strong>Height:</strong> ${heightValue} <strong>Date:</strong> ${currentDate}</p>`;

            // Append the new div to the `boy` element
            boy.appendChild(boyInfoContainer);

        } else {
            alert('Please enter a height between 0 and 8.');
        }

        // Reset the height input field
        heightInput.value = '';
    });

    // Add an event listener to reset height and markers when the gender selection changes
    genderSelect.addEventListener('change', function() {

        // Clear the markers
        markersContainer.innerHTML = '';

        // Clear the height display
        heightDisplay.innerHTML = '';

        // Clear the recent heights
        recentHeights.innerHTML = '';

        // Clear height history
        heightHistory = [];

        boy.classList.remove('active');

        boy.style.height = 'auto';


        // Remove the boyInfoContainer if it exists
        const existingBoyInfoContainer = document.getElementById('boyInfoContainer');
        if (existingBoyInfoContainer) {
            existingBoyInfoContainer.remove();
        }
    });
});





